  false,\n\t\"url\": null,\n\t\"notes\": \"This is a part of the National Geophysical
  Data Center (NGDC) Seafloor Surficial Sediment (Deck 41) Data File. Deck 41 is an
  original data file created by the Marine Geology and Geophysics Group of NGDC from
  1970-1975, abstracted from unpublished material contributed to NGDC by multiple
  groups of individuals. No updates of Deck 41 have been added since 1975. The data
  that comprise this portion of Deck 41 were generated by R.L. Wigley during 1965
  aboard ALBATROSS IV cruises 65-2, 65-13, and 65-14.\",\n\t\"license_title\": null,\n\t\"extras\":
